// src/components/OrderTracking.js
import React from 'react';

const OrderTracking = () => {
    return (
        <div>
            <h1>Order Tracking</h1>
            <p>Order ID: 12345</p>
            <p>Status: Preparing</p>
        </div>
    );
};

export default OrderTracking;
